    public static String GetChineseSpell(String text) {
        if (text == null || text.length() == 0) return text;
        StringBuffer stringBuffer = new StringBuffer();
        for (int i = 0; i < text.length(); i++) {
            char vChar = text.charAt(i);
            if ((vChar >= 'a' && vChar <= 'z') || (vChar >= 'A' && vChar <= 'Z')) stringBuffer.append(vChar); else if ((int) vChar >= 19968 && (int) vChar <= 40869) {
                stringBuffer.append(STR_CHINESE_FIRST_PY.charAt((int) vChar - 19968));
            }
        }
        return stringBuffer.toString();
    }

